remove () {
	echo "remove"
	rm -rf $VSENV
	for file in $(echo $binls|base64 -d); do
		rm -f $HOME/bin/$file
	done
}

create () {
	remove
	echo "create"
	mkdir -p $VSENV

	base64 -d <<< "$bashrc" 	> $VSENV/.bashrc
	base64 -d <<< "$screenrc" 	> $VSENV/.screenrc
	base64 -d <<< "$vimrc" 	> $VSENV/.vimrc

	cd $HOME
	tar -xzf <(base64 -d <<< "$bindir")
}
	
while getopts "rc" flag
do
	case $flag in
		r) 	remove;;
		c) 	create;;
	esac
done

if [ -d $VSENV ]; then
	screen -S $USER -c $VSENV/.screenrc
fi

